import React, { Component } from 'react';
import rocky from './App.module.css';
import Tasks from '../components/ViewContent/Tasks/Tasks';

import Cockpit from '../components/Cockpit/Cockpit';
import classes from '../components/Cockpit/Cockpit.module.css';

import WithClass from '../hoc/WithClass';

import RightCockpit from './RightCockpit/RightCockpit';

// var CanvasJSReact = require('./canvasjs.react');
// var CanvasJS = CanvasJSReact.CanvasJS;
// var CanvasJSChart = CanvasJSReact.CanvasJSChart;

//import Student from './Student.css';
//import StudentTable from './StudentTable'
// import StudentTable from './StudentTable';
//import Navbar from '../components/Cockpit/navBar';
//import Syllabus from '../components/Syllabus/Syllabus';

//import for bootstraps
// import axios from 'axios';
// import { Container, Row, Col } from 'reactstrap';
// import Post from '../components/Post';
// import Header from '../components/Header';
// import SideCard from '../components/SideCard';

//fo react dates
import Icon from './icon';
import { Form, Input, FormGroup, Container, Label } from 'reactstrap';
import 'react-dates/initialize';
import 'react-dates/lib/css/_datepicker.css';
import { SingleDatePicker } from 'react-dates';

import TasksData from './Store/TasksData';
import SyllabusData from './Store/SyllabusData';
import Store from './Store/Store';
class App extends Component {
  constructor(props) {
    super(props);

    //react date
    this.state = {
      date: null,
      focused: null
    };
  }
  //
  //React Date

  render() {
    let showCaseReactDate = (
      <div>
        <Container>
          <Form>
            <FormGroup>
              <Label for="firstname">Name: </Label>
              <Input type="text" name="firstname" />
            </FormGroup>
            <FormGroup>
              <Label for="lastname">Last Name: </Label>
              <Input type="text" name="lastname" />
            </FormGroup>
            <FormGroup>
              <SingleDatePicker
                // showClearDate={true}
                customInputIcon={
                  <svg className="icon icon-small">
                    <Icon icon="ICON_CALENDER" className="icon icon-large" />
                  </svg>
                }
                inputIconPosition="after"
                small={true}
                block={false}
                numberOfMonths={1}
                date={this.state.date}
                onDateChange={date => this.handleDateChange(date)}
                focused={this.state.focused}
                onFocusChange={({ focused }) => this.setState({ focused })}
                openDirection="up"
                hideKeyboardShortcutsPanel={true}
              />
            </FormGroup>
          </Form>
        </Container>
      </div>
    );
    return (
      <WithClass passClass={rocky.App}>
        {showCaseReactDate}
        <Store />
      </WithClass>
    );
  }
}
//<p>{this.props.appTitle}</p>
export default App;
